import React, {Component} from 'react';
import Latex from 'react-latex';

function ResultComponent() {
	const R = 10000;
	const C = 1 * 10 ** -6;
	const [Vs, set_Vs] = useState(10);
	const T = R * C;
	const [t, set_t] = useState(0);
	const VcLatex = "$V_c = V_s(1 - 10^{-\\frac{t}{T}})$";
	const Vc = Vs * (1 - 10 ** (-1 * t / T));


	return (
		<div className="calc">
             <div>
                    <h3>
                        <Latex>What is $(3\times 4) \div (5-3)$</Latex>
                    </h3>
                    <br/>
                    <input type="text"/>
                    <br/>
                    <button name="*" onClick={"addText()"}>*</button>
                 </div>

			<h1>Calc a</h1>
			<div>R = {R}</div>
			<div>C = {C.toExponential()}</div>
			<div>
				<Latex>$V_s$</Latex> = <input onChange={(e) => set_Vs(e.target.value)} value={Vs} />
			</div>
			<div>T = RC = {T}</div>
			<div>
				t = <input onChange={(e) => set_t(e.target.value)} value={t} />
			</div>
			<div>
				<Latex>{VcLatex}</Latex> = {Vc.toExponential(2)}
			</div>
		</div>
	);
}

export default ResultComponent
